    useEffect(() => {
        fetch('GaleryJS.json'+ id)
        .then(res => res.json())
        .then(data => {
          setMovie(data)
        })
      },[]);
	const [galery, setGalery] = useState([])
    return (
            <div className="galery-info">
        {
            GaleryJS.map(info => (
              <GlInfoItem data={info}/>
            ))
